function createSectionSearchPrd(sectionNum, sectionPrdList, useSprite, tab_id){
var prdHTML = productHtmlBlock;
if(useSprite===true) {
prdHTML = productHtmlBlock.replace(/(img\ssrc="http:\/\/static1\.shopoon\.fr\/catalog\/products\/NoImageBIG\.jpg"\s+)(width="[0-9]+"\s+height="[0-9]+"\s+)?(border="0"\s+)?(alt="\{[0-9]\}"\s+)?(title="\{[0-9]\}(\s+(avec\s+)?\{[0-9]\})?"\s+)?(class="(img[0-9]+)?(prdImg)?"\s+)?(style="margin:0 auto;"\s+)?\/>/gi, 'div class="prdImg sp-products-'+tab_id+' [CLASSPRDIMG]"></div>');
}
document.getElementById("section"+sectionNum).innerHTML=String.format(sectionHtmlBlock,sectionNum);
var prod_i=(sectionNum-1)*jsonShoppingBoxEnt.ProductsPerPage;
var td_i = 0;
while(sectionPrdList[prod_i]){
if(td_i >= jsonShoppingBoxEnt.ProductsPerPage){break;}
if(prdHTML.indexOf("img200")>-1){sectionPrdList[prod_i].default_picture=sectionPrdList[prod_i].default_picture.replace("[WBFORMAT]", "250x250");}
else{sectionPrdList[prod_i].default_picture=sectionPrdList[prod_i].default_picture.replace("[WBFORMAT]", "100x100");}
var productBlock=String.format(prdHTML, TrimString(sectionPrdList[prod_i].name, 10), sectionPrdList[prod_i].default_picture, TrimString(sectionPrdList[prod_i]._brand_name, 10), sectionPrdList[prod_i].price, (sectionPrdList[prod_i].rebate > 0 ? "<div class=\"reduc\">-"+sectionPrdList[prod_i].rebate+"%</div>" : ""), sectionPrdList[prod_i]._partner_name, sectionPrdList[prod_i]._redirect + '/bx/' + jsonShoppingBoxEnt.id, sectionPrdList[prod_i].name, sectionPrdList[prod_i].id, sectionPrdList[prod_i].description, prod_i,sectionPrdList[prod_i]._brand_name, (sectionPrdList[prod_i].price.toString().indexOf('.00') > -1 ? parseFloat(sectionPrdList[prod_i].price).toFixed(0) : parseFloat(sectionPrdList[prod_i].price).toFixed(2).replace('.', ',')), sectionPrdList[prod_i]._brand_name.toLowerCase());
productBlock=productBlock.replace('http://static1.shopoon.fr/catalog/products/NoImageBIG.jpg',sectionPrdList[prod_i].default_picture);
if(jsonShoppingBoxEnt._tabs[jsonShoppingBoxEnt.CurrentTab].sprite_products_css && jsonShoppingBoxEnt._tabs[jsonShoppingBoxEnt.CurrentTab].sprite_products_css.indexOf('sp-img-prd-') > -1){
productBlock=productBlock.replace('[CLASSPRDIMG]','sp-img-prd-'+tab_id+'-'+sectionPrdList[prod_i].id);}
else{
productBlock=productBlock.replace('[CLASSPRDIMG]','sp-'+sectionPrdList[prod_i].id);}
if(document.getElementById("product"+sectionNum+""+td_i)) document.getElementById("product"+sectionNum+""+td_i).innerHTML = productBlock;
prod_i++;
td_i++;
}
};
