function shuffleArray (arrayToShuffle){
var i = arrayToShuffle.length;
if ( i == 0 ) return false;
while ( --i ){
var j = Math.floor( Math.random() * ( i + 1 ) );
var tempi = arrayToShuffle[i];
var tempj = arrayToShuffle[j];
arrayToShuffle[i] = tempj;
arrayToShuffle[j] = tempi;
}
return arrayToShuffle;
};
String.format = function( text ){
if ( arguments.length <= 1 )
return text;
var tokenCount = arguments.length - 2;
for( var token = 0; token <= tokenCount; token++ ){
text = text.replace( new RegExp( "\\{" + token + "\\}", "gi" ), arguments[ token + 1 ] );
}
return text;
};
function trimAccents(stringToTrim){
stringToTrim = escape(stringToTrim);
stringToTrim = unescape(stringToTrim);
stringToTrim = stringToTrim.replace(/[âäà]/g,"a");
stringToTrim = stringToTrim.replace(/[êëéè]/g,"e");
stringToTrim = stringToTrim.replace(/[îïèi]/g,"i");
stringToTrim = stringToTrim.replace(/[ôöò]/g,"o");
stringToTrim = stringToTrim.replace(/[ûüù]/g,"u");
stringToTrim = stringToTrim.replace(/[ç]/g,"c");
return stringToTrim;
};
